import React from "react";
import Head from "./header";
import "./body.css";
import Footer from "./footer";
import ContactUs from "./contactus";
import AOS from "aos";
import "aos/dist/aos.css";
import Services from "./ourservice";
import Portfolio from "./portfolio";

function Home() {
  AOS.init();
  return (
    <div>
      {/* data-aos="zoom-out" */}
      <Head />
      <div>
        <div className="banner"  aos-duration="100" style={{ zIndex: "-1" }} >
          <div>
            <hr style={{ marginTop: "0em" }} />
            <div className="welcome">Welcome to TECH4SKILLS</div>
            <div className="welcome1">
            A Platform for a new journey in your technology career!
            </div>
            <div style={{textAlign:"center",marginTop:"2em"}}>
            <div className="cohort">Interested In Our Next Cohort By Booking A Spot?</div>
            <button className="cohort-btn">ENROLL NOW</button>
            </div>
          </div>
        </div>

{/* <Services/> */}
<Portfolio/>

      </div>
      <Footer />
    </div>
  );
}

export default Home;
